B.afv=new A.du("# %R Does GirAppe Studio / Pass4Wallet sells ot re-sells an event tickets?\n","GirAppe Studio is not selling or re-selling any tickets or vouchers; we are just providing a tool to digitalize your tickets/ cards.\n\nPlease be extremly careful when buying tickets online, and keep in mind that anyone can generate a ticket entry using our app. We take no reesponsibility for peaople who abuse our application and use it unethically.\n",t.W)
B.afE=new A.du("# %R How to remove a pass?\n","To remove a pass:\n\n1. On your iPhone, open the Wallet app (**do not open Wallet using double click on iPhone side button!**).\n2. Tap the pass that you want to remove.\n3. Tap the More button .\n4. Tap Remove Pass, then confirm.\n\nHere is a helpful link with screenshots: https://support.apple.com/en-us/HT212170\n",t.W)
B.afz=new A.du("# %R Why the app is not in language X?\n","We are working hard to make using Pass4Wallet easy for everyone, regardless of their language. Unfortunately, we only speak few languages. The initial translation set is a result of asking all our friends and collegues for help. But we don't want to overuse that option.\n\nPass4Wallet is a free app and we currently do not earn any money from it. So there is little to justify spending money on professional translations. We are using free translation services to some extent, but we fear the quality might not be good enough.\n\nWe are currently working on a way to allow our users to participate in the translation process, which will greatly enhance the process and should boost overall translations quality.\n",t.W)
B.aft=new A.du("# %R How can I support GirAppe?\n","You might not believe it, but there are actually people writing to us, willing to pay for the app :)\n\nWe are sure we want to keep Pass4Wallet free like, forever. And we are looking for a way to allow supporting us,  along with Apple guidelines and a common sense.\n\nWe will definitely tell our users if we found such a way.\n",t.W)
B.afn=new A.du("# %R Why Google Images search does not work?\n","Google Images api is a paid service. We did not found a justification good enough to burn money on it, mostly because Pass4Wallet is free app and will remain free. Another issue is security; at the moment we don't risk money if someone extracts api keys from the app.\n\nAlso, this is not the most crucial part of the service, you can use your browser to find and save desired image, and then us it in the app.\n\nSo, to sum up, we will remain using curent approach, and being restricted by the free searches quota. It is far less convenient, but we hope you can understand our reasons.\n",t.W)
B.afC=new A.du("# %R Are you storing any of my data anywhere?\n","No, we are not.\n\nWe are sending the data to our backend for processing (signing pass with Apple issued certificate), but we do not keep any data. Every request to create a pass is processed in temporary directory, which is purged in the moment we send pass back.\n",t.W)
B.afp=new A.du("# %R Why are you not sending just a signature to the server?\n","This is mostly due to historical reasons, as we planned to have an option to store passes on our server, and use Apple push services to update passes when the original changed. This feature might come eventually.\n\nSecond reason is of technical nature, as composing a pkpass file and signing it was easier to do on the server.\n\nWe intend to update the behaviour to only send signatures as soon as we have time to revisit the backend implementation.\n",t.W)
